import React, { Component } from 'react'
import Header from './Header'
import Navigation from './Navigation'
import Content from './Content'

export default class List extends Component {
    render() {
        return (
            <div>
                <Header></Header>
                <Navigation></Navigation>
                <Content></Content>
            </div>
        )
    }
}
